import React from "react";

function NavBar() {
  return (
    <nav className="navbar flex items-right font-bold justify-between px-3 py-3 bg-red-900 text-white">
      <div className="logo-container">
        <img src="/images/logo.png" alt="Logo" className="logo" />
      </div>
      <ul className="admissions">ADMISSIONS</ul>
      <ul className="academics">ACADEMICS</ul>
      <ul className="career">CAREER DEVELOPMENT CENTER</ul>
      <ul className="facilities">FACILITIES</ul>
      <ul className="campusLife">CAMPUS LIFE</ul>
      <ul className="research">RESEARCH</ul>
      <ul className="about">ABOUT</ul>
      <ul className="campuses">VIT CAMPUSES</ul>
    </nav>
  );
}

export default NavBar;
